INSERT INTO `rbac_permissions` (`ID`, `Lft`, `Rght`, `Title`, `Description`) VALUES
(1, 0, 1, 'form_inserir_alterar_contagem_livre', 'Inserção de contagem sem relação com a Baseline e são geralmente inseridas para Indicativas e Estimativas baseadas na NESMA'),
(2, 0, 1, 'form_inserir_alterar_contagem_baseline', 'Inserção de contagem de Baseline. Utilizada quando a contagem servir de referência para outras contagens de projeto.'),
(3, 0, 1, 'form_inserir_alterar_contagem_projeto', 'Utilizada quando a contagem for alterar uma Baseline previamente definida.'),
(4, 0, 1, 'form_inserir_alterar_contagem_licitacao', 'Utilizada geralmente por Órgãos Públicos para definir o preço de uma licitação para um ou para vários projetos.'),
(5, 0, 1, 'listar_contagens_validadas', '(Todas) lista as contagens validadas da sua organização.'),
(6, 0, 1, 'listar_contagens_validacao_interna', '(Todas) Lista as contagens em validação na sua organização.'),
(7, 0, 1, 'listar_contagens_revisao', '(Todas) Lista as contagens em revisão na sua organização.'),
(8, 0, 1, 'listar_contagens_elaboracao', '(Todas) Lista as contagens em elaboração na sua empresa.'),
(9, 0, 1, 'gerenciar_usuario', 'Permissão para realizar o gerenciamento de usuários no sistema'),
(10, 0, 1, 'gerenciar_cliente', 'Gerenciamento de clientes (inserção, alteração, atualização)'),
(11, 0, 1, 'gerenciar_contrato', 'Gerenciamento de contrato (inserção, alteração, atualização). Inclui também o gerenciamento de aditivos contratuais.'),
(12, 0, 1, 'gerenciar_perfil_usuario', 'Gerenciamento de perfis de usuários. Adiciona exceções às regras p.ex. se um usuário está no grupo Analista de Métricas e não tem a função de \"validar\", o gerenciamento de perfil permite adicionar esta função especificamente para o usuário.'),
(13, 0, 1, 'gerenciar_roteiro', 'Gerenciamento de roteiros de métricas.'),
(14, 0, 1, 'gerenciar_item_roteiro', 'Gerenciamento dos itens do roteiro de métricas.'),
(15, 0, 1, 'configuracao_contagem', 'Gerenciamento das contagens da sua organização.'),
(16, 0, 1, 'compartilhar_empresa', 'Permite que o usuário compartilhe sua contagem com uma empresa externa.'),
(17, 0, 1, 'compartilhar_diretorio', 'Permite que o usuário compartilhe sua contagem em um diretório público, onde todos podem acessar. Quem for acessar a contagem precisa de uma licença do PF.Dimension, caso contrário a contagem será disponibilizada em formato .JSON e/ou .XML.'),
(18, 0, 1, 'compartilhar_orgao', 'Permite que o usuário compartilhe uma contagem com um Órgão Público. Para isso é necessário que o Órgão possua licenças do PF.Dimension.'),
(19, 0, 1, 'configuracao_compartilhamento', 'Habilita as opções de compartilhamento ou não para os usuários. Mesmo assim é necessário que o usuário possua as funcionalidades de compartilhamento de contagens.'),
(20, 0, 1, 'configuracao_empresa', 'Para os perfis Administrador, tanto da empresa como do Fornecedor, configura as informações da empresa/fornecedor: Nome, contatos, logomarca, etc.'),
(21, 0, 1, 'copiar_contagem', 'Permite ao usuário a funcionalidade de copiar a contagem.'),
(22, 0, 1, 'colaboracao_contagem', 'Permite ao usuário solicitar a edição compartilhada da contagem, ou seja, duas ou mais pessoas podem editar a contagem ao mesmo tempo, sendo que só uma continua como proprietária da contagem.'),
(23, 0, 1, 'validar_contagem', 'Permite que usuários, mesmo não sendo do grupo Validadores, possam validar contagens. Adicione sempre que um usuário do grupo Analista de Métricas possua conhecimento suficiente para colaborar com as validações.'),
(24, 0, 1, 'validar_externa', 'Função para validação externa de contagens, geralmente atribuída a um grupo de validadores que está no Cliente ou a um grupo contratado para validações.'),
(25, 0, 1, 'auditar_interna', 'Função para auditoria interna das contagens. Diferentemente das validações a auditoria apenas faz apontes e não revisa contagens.'),
(26, 0, 1, 'auditar_externa', 'Função de auditoria externa das contagens, geralmente atribuída a um grupo de pessoas de um Órgão público (AGU, TCU, etc)'),
(27, 0, 1, 'excluir_contagem', 'Função para exclusão de contagens. Geralmente é atribuída as grupo Gestores.'),
(28, 0, 1, 'administracao', 'Apenas para permitir o acesso ao menu de administração. Atribuição geralmente feita para Gestores, Gerentes de Conta, Administradores e Gerentes de Projeto'),
(29, 0, 1, 'alterar_contagem', 'Função para alteração de contagens, geralmente atribuída aos Gestores, Validadores e Analistas de Métricas'),
(30, 0, 1, 'revisar_contagem', 'Função para revisão de contagens, geralmente atribuída aos Gestores e Analistas de Métricas'),
(31, 0, 1, 'contagem_anexos_visualizar', 'Permite que os usuários possam visualizar os anexos.'),
(32, 0, 1, 'exportar_pdf_resumo', 'Permite a exportação do .PDF em resumo'),
(33, 0, 1, 'exportar_pdf_detalhado', 'Permite a exportação do .PDF detalhado.'),
(34, 0, 1, 'exportar_pdf_detalhado_estatisticas', 'Permite a exportação do .PDF detalhado mais as estatísticas.'),
(35, 0, 1, 'exportar_html', 'Permite a exportação do .HTML da contagem.'),
(36, 0, 1, 'exportar_json', 'Permite a exportação da contagem em formato .JSON'),
(37, 0, 1, 'exportar_xml', 'Permite a exportação da contagem em formato .XML'),
(38, 0, 1, 'exportar_ods', 'Permite a exportação da contagem em formato .ODS (Open Document)'),
(39, 0, 1, 'exportar_xls', 'Permite a exportação da contagem em formato .XLS (TM - Microsoft Corporation)'),
(40, 0, 1, 'exportar_xlsx', 'Permite a exportação da contagem em formato .XLSS (TM - Microsoft Corporation)'),
(41, 0, 1, 'exportar_ifpug', 'Permite a exportação da contagem em formato de planilha .ODS no padrão disponibilizado pelo IFPUG. Utilizamos a planilha que está no site da FattoCS (http://www.fattocs.com.br)'),
(42, 0, 1, 'mesclar_contagens', 'Geralmente esta funcionalidade é atribuída aos Gerentes de Projeto que podem mesclar as contagens para facilitar o gerenciamento e o planejamento dos projetos.'),
(43, 0, 1, 'inserir_comentario_auditoria_interna_linha', 'Inserção de comentários do Auditor Interno para uma linha específica'),
