(64, 0, 1, 'form_financeiro', 'Formulário que acessa a lista para pagamentos e acompanhamento financeiro'),
(65, 0, 1, 'gerenciar_fornecedor', 'Tab que permite ao perfil gerenciar os fornecedores'),
(66, 0, 1, 'configuracao_relatorios', 'Tab que permite ao perfil a configuração dos relatórios'),
(67, 0, 1, 'gerenciar_projeto', 'Permissão para acessar a aba que realiza a gestão dos projetos contratados pela empresa. Não é para o perfil Gerente de Projetos.'),
(68, 0, 1, 'form_inserir_alterar_contagem_ef', 'Uma nova métrica de software de tamanho funcional derivada da Análise de Pontos de Função (APF), composta por duas submétricas - Elementos Funcionais de Dados (EFd) e Elementos Funcionais de Transação (EFt)'),
(69, 0, 1, 'form_comissionado', 'Formulário de controle de comissionados'),
(70, 0, 1, 'turmas_treinamentos', 'Funcionalidade direcionada para escolas que prestam treinamentos em Análises e Métricas e montam turmas no sistema.'),
(71, 0, 1, 'comparar_contagens', 'Funcionalidade que permite ao fiscal do contrato comparar contagens em casos de conflitos entre uma empresa que faz somente análises e uma fábrica de software, por exemplo.'),
(72, 0, 1, 'enviar_validacao_externa', 'Permite ao usuário enviar uma contagem para validação externa'),
(73, 0, 1, 'enviar_auditoria_interna', 'Permite ao usuário enviar uma contagem para auditoria interna'),
(74, 0, 1, 'enviar_auditoria_externa', 'Permite ao usuário enviar uma contagem para auditoria externa'),
(75, 0, 1, 'form_dashboard', 'Dashboard gerencial do sistema liberado para todos os perfis acima de gestor'),
(76, 0, 1, 'finalizar_contagem', 'Este processo é o responsável por enviar a contagem para o faturamento'),
(77, 0, 1, 'faturar_contagem', 'Processo final de encerramento da contagem, quando o fiscal/financeiro/gestor certifica que a contagem foi faturada'),
(78, 0, 1, 'listar_contagens_faturamento_autorizado', 'Lista as contagens finalizadas em que o Fiscal de Contrato autorizaou o faturamento e prontas para o faturamento'),
(79, 0, 1, 'listar_contagens_faturadas', 'Lista as contagens que foram faturadas em determinado período de tempo'),
(80, 0, 1, 'inserir_contagem_auditoria', 'Este é um tipo especial de inserção de contagem, pois a permissão habilita o usuário a inserir contagens em todos os contratos/projetos da empresa. O Fiscal do Contrato utiliza esta contagem para comparar com a contagem feita pela geralmente pela Fábrica de Software.'),
(81, 0, 1, 'inserir_alterar_analise_fiscal_contrato', 'Permite ao Fiscal do Contrato inserir e/ou alterar uma análise e/ou uma comparação entre contagens e aferições'),
(82, 0, 1, 'form_gerenciar_orgao', 'Permite ao usuário o gerenciamento de Órgãos, que também podem ser chamados de Setores, Departamento, etc.');
