INSERT INTO `rbac_roles` (`ID`, `Lft`, `Rght`, `Title`, `short_name`, `Description`) VALUES
(1, 0, 1, 'administrador', 'Administrador', 'Administrador do sistema'),
(2, 0, 1, 'validador_interno', 'Validador Interno', 'Validador que pertence a organização, geralmente este é o perfil para quem está em um grupo de validadores'),
(3, 0, 1, 'validador_externo', 'Validador Externo', 'Perfil que pertence geralmente ao Cliente. O validador externo pode pertencer também a um grupo de validadores contratados por sua organização'),
(4, 0, 1, 'auditor_interno', 'Auditor Interno', 'Grupo de usuários que fazem auditoria interna nas contagens. A diferença entre um Auditor e um Validador (interno) é que este não insere/altera contagens.'),
(5, 0, 1, 'auditor_externo', 'Auditor Externo', 'Grupo de usuários que fazem auditoria externa nas contagens, geralmente associado a usuários que estão em órgãos de controle (TCU, CGU, etc.)'),
(6, 0, 1, 'gestor', 'Gestor', 'Perfil interno a organização. Este perfil possui a capacidade de gerenciar grupos de validadores e analistas de métricas. Pode inserir/alterar contagens e também pode validar. Ex. Caso um validador saia de férias, o gestor pode validar ou trocar o validador.'),
(7, 0, 1, 'analista_metricas', 'Analista de Métricas', 'O analista de métricas é o perfil básico do sistema e está associado à Análise de Pontos de Função, inserção, alteração, revisão.'),
(8, 0, 1, 'gerente_projetos', 'Gerente de Projetos', 'O gerente de projetos é o perfil que pode dentre outras funcionalidades iniciar o planejamento de execução das contagens. Ele também pode mesclar contagens para facilitar o gerenciamento.'),
(9, 0, 1, 'gerente_conta', 'Gerente de Contas', 'Também pode ser denominado Gerente, Preposto, etc. É a pessoa responsável pelos Clientes e Contratos'),
(10, 0, 1, 'diretor', 'Diretor', 'Perfil genérico de diretoria e tem acesso às estatísticas gerenciais (dashboard) da aplicação'),
(11, 0, 1, 'viewer', 'Visualizador', 'Perfil de visualização no sistema, apenas lê, não efetua nenhuma ação de escrita. Atribua este perfil para dar acesso a qualquer usuário que seja da sua organização ou não mas que tenha interesse apenas observar. Pode ser o caso de desenvolvedores, dba\'s, analistas, gerentes, usuários no cliente, etc.'),
(13, 0, 1, 'financeiro', 'Financeiro', 'Perfil que gerencia a parte de faturamento de usuários no sistema, boletos, notas fiscais e contrato com a Dimension.'),
(14, 0, 1, 'instrutor', 'Instrutor', 'Perfil associado ao instrutor da turma de treinamento'),
(15, 0, 1, 'comissionado', 'Comissionado', 'Perfil de colaborador comissionado que recebe um percentual sobre as indicações de empresas'),
(16, 0, 1, 'fiscal_contrato', 'Fiscal de contrato', 'Este perfil é o responsável pela fiscalização das contagens, ele pode comparar contagens feitas entre uma empresa contratada e uma empresa que faz especificamente as contagens.'),
(17, 0, 1, 'cadastrador', 'Cadastrador', 'Perfil de quem apenas abre uma contagem no sistema, sem necessariamente realizar a contagem. É um perfil destinado a auxiliar o analista de métricas');
