(1, 'SISP 2.1', 'Roteiro padrão estabelecido pela &#60;i class=\\&#39;fa fa-cube\\&#39;&#62;&#60;/i&#62;&#38;nbsp;Dimension utilizando &#38;copy; o roteiro SISP 2.1 do Ministério do Planejamento. Este é o roteiro padrão da ferramenta e não pode ser alterado.', '1', 0, 0, 0, 1, 0, '2017-01-04 13:54:11', 'gestor@pfdimension.com.br'),
(2, 'Guia Data Warehouse 1.0', 'Este guia tem como objetivo definir as diretrizes e as regras de contagem e estimativa do tamanho funcional de projetos de DW, usando a métrica Análise de Pontos de Função, e apoiar os órgãos integrantes do Sistema de Administração dos Recursos de Tecnologia da Informação (SISP) na contratação de serviços de desenvolvimento e manutenção de projetos de DW.', '1', 0, 0, 0, 1, 0, '2016-10-04 14:10:55', 'gestor@pfdimension.com.br'),
(3, 'Dimension 1.0', 'Roteiro temporário utilizado quando o Analista de Métricas insere funcionalidades através das pesquisas, CRUD automático, etc. Instalar com o #ID3, sem exceção.', '1', 0, 0, 0, 1, 0, '2017-03-28 17:22:59', 'gestor@pfdimension.com.br');
